INSERT INTO `app_base_yaml` VALUES (85, 41, 'redis-configmap-cm', 'ConfigMap', 'admin', 'admin', 0, '{\"apiVersion\":\"v1\",\"data\":{\"redis.conf\":\"daemonize no\\nport 6379\\nbind 0.0.0.0\\nrequirepass octa8lab\\nmasterauth octa8lab\\npidfile /usr/local/redis/pid/redis.pid\\nlogfile \\\"\\\" \\ndbfilename \\\"redis.rdb\\\"\\ndir \\\"/data/redis\\\"\\ntcp-keepalive 60\\ntcp-backlog 511\\ntimeout 3000\\nloglevel notice\\ndatabases 16\\nsave 900 1\\nsave 300 10\\nsave 60 10000\\nstop-writes-on-bgsave-error no\\nrdbcompression yes\\nslave-serve-stale-data no\\nrepl-diskless-sync yes\\nrepl-diskless-sync-delay 5\\nrepl-disable-tcp-nodelay no\\nslave-priority 100\\nappendonly no\\nno-appendfsync-on-rewrite yes\\nlua-time-limit 5000\\nslowlog-log-slower-than 10000\\nslowlog-max-len 128\\nlatency-monitor-threshold 0\\nnotify-keyspace-events \\\"\\\"\\nhash-max-ziplist-entries 512\\nhash-max-ziplist-value 64\\nlist-max-ziplist-entries 512\\nlist-max-ziplist-value 64\\nset-max-intset-entries 512\\nzset-max-ziplist-entries 128\\nzset-max-ziplist-value 64\\nhll-sparse-max-bytes 3000\\nactiverehashing yes\\nclient-output-buffer-limit normal 0 0 0\\nclient-output-buffer-limit slave 256mb 64mb 60\\nclient-output-buffer-limit pubsub 64mb 16mb 60\\nhz 10\\n\"},\"kind\":\"ConfigMap\",\"metadata\":{\"labels\":{\"app.oscro.io/name\":\"redis\"},\"name\":\"redis-configmap-cm\",\"namespace\":\"VALUE\"}}', '857b934b-af9c-68e9-f055-ab9f36f935ba', '2023-06-02 06:46:02.935', '2023-06-02 06:46:02.935');
INSERT INTO `app_base_yaml` VALUES (87, 41, 'redis-deployment-dep', 'Deployment', 'admin', 'admin', 0, '{\"apiVersion\":\"apps/v1\",\"kind\":\"Deployment\",\"metadata\":{\"labels\":{\"app.oscro.io/name\":\"redis\"},\"name\":\"redis-deployment-dep\",\"namespace\":\"zyytest-test\"},\"spec\":{\"replicas\":1,\"selector\":{\"matchLabels\":{\"app.oscro.io/name\":\"redis\"}},\"template\":{\"imagePullSecrets\":[{\"name\":\"registry-secret\"}],\"metadata\":{\"labels\":{\"app.oscro.io/name\":\"redis\"}},\"spec\":{\"containers\":[{\"image\":\"octahub.8lab.cn:5000/pub-image/redis:v0421\",\"name\":\"redis\",\"ports\":[{\"containerPort\":6379,\"name\":\"redis\"}],\"resources\":{\"limits\":{\"cpu\":\"300m\",\"memory\":\"200Mi\"},\"requests\":{\"cpu\":\"200m\",\"memory\":\"200Mi\"}},\"volumeMounts\":[{\"mountPath\":\"/usr/local/redis/redis.conf\",\"name\":\"redis-configmap-cm\",\"subPath\":\"redis.conf\"},{\"mountPath\":\"/data/redis\",\"name\":\"redis-persistentvolumeclaim-pvc\"}]},{\"args\":[\"-redis.password=octa8lab\",\"-redis.addr=127.0.0.1:6379\"],\"image\":\"octahub.8lab.cn:5000/pub-image/redis_exporter:v0608\",\"imagePullPolicy\":\"Always\",\"name\":\"redis-exporter\",\"ports\":[{\"containerPort\":9121,\"name\":\"exporter\"}],\"resources\":{\"limits\":{\"cpu\":\"50m\",\"memory\":\"50Mi\"},\"requests\":{\"cpu\":\"50m\",\"memory\":\"50Mi\"}}}],\"imagePullSecrets\":[{\"name\":\"registry-secret\"}],\"restartPolicy\":\"Always\",\"securityContext\":{\"sysctls\":[{\"name\":\"net.core.somaxconn\",\"value\":\"65535\"}]},\"volumes\":[{\"configMap\":{\"name\":\"redis-configmap-cm\"},\"name\":\"redis-configmap-cm\"},{\"name\":\"redis-persistentvolumeclaim-pvc\",\"persistentVolumeClaim\":{\"claimName\":\"redis-persistentvolumeclaim-pvc\"}}]}}}}', '4c0e00af-96d3-1b41-9ee6-e6976492b8d2', '2023-06-02 06:46:02.939', '2023-06-02 06:46:02.939');
