INSERT INTO `app_base_yaml` VALUES (275, 113, 'consul-initpoicy-configmap-cm', 'ConfigMap', 'admin', 'admin', 0, '{\"apiVersion\":\"v1\",\"data\":{\"initpolicy.sh\":\"#!/bin/bash\\nexport CONSUL_HTTP_TOKEN=`grep -r initial /data/config/|awk -F\'\\\"\' \'{print $4}\'`\\nset -ux\\n#创建策略\\nconsul acl policy create -name \\\"node-r\\\" -description \\\"node read\\\" -rules \'node_prefix \\\"\\\"{policy = \\\"read\\\"}\' \\u0026\\u003e /dev/null\\n\\nconsul acl policy create -name \\\"service-w\\\" -description \\\"service write\\\" -rules \'service_prefix \\\"\\\"{policy = \\\"write\\\"}\' \\u0026\\u003e /dev/null\\n\\nconsul acl policy create -name \\\"service-main-deny\\\" -description \\\"deny service_prefix main\\\" -rules \'service_prefix \\\"main\\\"{policy = \\\"deny\\\"}\' \\u0026\\u003e /dev/null\\n\\n#创建mainserver角色\\nconsul acl role create  -name \\\"mainRegister\\\" -description \\\"mainServer role\\\" -policy-name service-w -policy-name node-r \\u0026\\u003e /dev/null\\n#创建只允许注册角色\\nconsul acl role create -name \\\"otherRegister\\\" -description \\\"Only services with a prefix other than \'main\' are allowed to register\\\" -policy-name service-w -policy-name service-main-deny \\u0026\\u003e /dev/null\\n\\n#创建mainserver的token\\nconsul acl token list  |grep -w mainRegister || consul acl token create  -description \\\"mainServer service register\\\" -role-name \\\"mainRegister\\\"\\n#创建其他服务注册的token\\nconsul acl token list  |grep -w otherRegister || consul acl token create -description \\\"other service register\\\" -role-name \\\"otherRegister\\\"\\n\"},\"kind\":\"ConfigMap\",\"metadata\":{\"labels\":{\"app.oscro.io/name\":\"consul-initpoicy\"},\"name\":\"consul-initpoicy-configmap-cm\",\"namespace\":\"oscro-v2\"}}', '4ece9172-da53-f6dd-58d1-1eabe497cb78', '2023-07-21 07:18:02.181', '2023-07-21 07:18:02.181');
INSERT INTO `app_base_yaml` VALUES (277, 113, 'consul-initpoicy-job-j', 'Job', 'admin', 'admin', 0, '{\"apiVersion\":\"batch/v1\",\"kind\":\"Job\",\"metadata\":{\"labels\":{\"app.oscro.io/name\":\"consul-initpoicy\"},\"name\":\"consul-initpoicy-job-j\",\"namespace\":\"oscro-v2\"},\"spec\":{\"template\":{\"spec\":{\"containers\":[{\"args\":[\"/tmp/initpolicy.sh\"],\"command\":[\"sh\",\"-c\"],\"env\":[{\"name\":\"CONSUL_HTTP_ADDR\",\"value\":\"http://consul-client-service-svc:8500\"}],\"image\":\"octahub.8lab.cn:5000/oscro/consul:v1.15.2\",\"name\":\"init-policy\",\"resources\":{\"limits\":{\"cpu\":\"200m\",\"memory\":\"200Mi\"},\"requests\":{\"cpu\":\"200m\",\"memory\":\"200Mi\"}},\"volumeMounts\":[{\"mountPath\":\"/data/config\",\"name\":\"consul-initpoicy-configmap-acl\"},{\"mountPath\":\"/tmp/\",\"name\":\"consul-initpoicy-configmap-cm\"}]}],\"imagePullSecrets\":[{\"name\":\"registry-secret\"}],\"initContainers\":[{\"args\":[\"until wget -q -O - http://consul-client-svc:8500/v1/status/leader 2\\u003e/dev/null | grep -E \'\\\".+\\\"\'; do echo waiting for consul; sleep 2; done;\"],\"command\":[\"sh\",\"-c\"],\"image\":\"octahub.8lab.cn:5000/pub-image/busybox:1.28\",\"name\":\"wait-for-consul\"}],\"restartPolicy\":\"Never\",\"volumes\":[{\"configMap\":{\"name\":\"consul-initpoicy-configmap-acl\"},\"name\":\"consul-initpoicy-configmap-acl\"},{\"configMap\":{\"name\":\"consul-initpoicy-configmap-cm\"},\"name\":\"consul-initpoicy-configmap-cm\"}]}}}}', '001fb634-0f5e-0c0a-3a31-a325c62dae44', '2023-07-21 07:18:02.184', '2023-07-21 07:18:02.184');
