INSERT INTO `app_yaml` VALUES (109, 'oscroweb-cm', '{\"apiVersion\":\"v1\",\"data\":{\"front.conf\":\"map $http_upgrade $connection_upgrade {\\n    default upgrade;\\n    \'\' close;\\n}\\nserver {\\n        listen         10083;\\n        server_name    .*;\\n        charset UTF-8;\\n        access_log      /data/logs/nginx/access.log;\\n        error_log       /data/logs/nginx/error.log;\\n\\n        client_max_body_size 75M;\\n        gzip on;\\n        gzip_comp_level 3;\\n        gzip_types application/javascript image/png video/mp4;\\n        gzip_vary on;\\n\\n        root        /usr/local/octa_optmain_porta_frontend/dist/;\\n        location / {\\n          try_files $uri $uri/ /index.html;\\n          index /index.html;\\n        }\\n        \\n        location ~ ^/api {\\n         proxy_set_header Upgrade $http_upgrade;\\n          proxy_set_header Connection \\\"$connection_upgrade\\\";\\n          proxy_set_header Host $http_host;\\n          proxy_set_header X-Real-IP $remote_addr;\\n          proxy_set_header X-Forwarded-For $proxy_add_x_forwarded_for;\\n          \\n          proxy_pass http://192.168.1.96:10090;\\n        }\\n}\\n\"},\"kind\":\"ConfigMap\",\"metadata\":{\"labels\":{\"app.oscro.io/name\":\"oscroweb\"},\"name\":\"oscroweb-cm\",\"namespace\":\"oscro-v2\"}}', '{\"apiVersion\":\"v1\",\"data\":{\"front.conf\":\"map $http_upgrade $connection_upgrade {\\n    default upgrade;\\n    \'\' close;\\n}\\nserver {\\n        listen         10083;\\n        server_name    .*;\\n        charset UTF-8;\\n        access_log      /data/logs/nginx/access.log;\\n        error_log       /data/logs/nginx/error.log;\\n\\n        client_max_body_size 75M;\\n        gzip on;\\n        gzip_comp_level 3;\\n        gzip_types application/javascript image/png video/mp4;\\n        gzip_vary on;\\n\\n        root        /usr/local/octa_optmain_porta_frontend/dist/;\\n        location / {\\n          try_files $uri $uri/ /index.html;\\n          index /index.html;\\